  <Popup
    trigger={<button className = "DeleteButton"><p className = "DeleteButtonText">Delete</p></button>}
    modal
    nested
  >
    {close => (
      <div className="modal">
        <button className="close" onClick={close}>
          &times;
        </button>
        <h2> Are you sure? </h2>
        <div className="content">
